import React from "react";
import ReactDom from "react-dom";
import "./index.css";

function SodaList() {
  return (
    <section className="sodaList">
      <soda brand={firstSoda.brand} flavor={firstSoda.flavor} />
    </section>
  );
}

const firstSoda = {
  brand: "coke",
  flavor: "cherry",
};

const soda = ({ brand, flavor }) => {
  return (
    <article>
      <p>{brand}</p>
      <p>{flavor}</p>
    </article>
  );
};

export default SodaList;
